import React from "react";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";

const SubjectsCard = ({ key, id, subjectName, mark }) => {
  console.log({ key });
  return (
    <Card className="SubjectsCard">
      <Card.Img className
        variant="top"
        src="https://img.gamedistribution.com/8e5e5f3b0e2b455fa4bcd53ddcf90fd0-512x512.jpeg"
      />
      <Card.Body>
        <Card.Title>
          <p>Subject name: {subjectName}</p>
        </Card.Title>
        <Card.Text>Mark: {mark}</Card.Text>
        <Button variant="primary">Edit Mark</Button>
        <Button variant="danger">Delete Subject</Button>
      </Card.Body>
    </Card>
  );
};

export default SubjectsCard;
